'use strict';
({params, imports}) => {
    const programEnrolment = params.entity;
    const moment = imports.moment;
    const formElement = params.formElement;
    const _ = imports.lodash;
    let visibility = true;
    let value = null;
    let answersToSkip = [];
    let validationErrors = [];

    const height = programEnrolment.getObservationValue("Height");
    const weight = programEnrolment.getObservationValue("Weight");
    const asOnDate = programEnrolment.enrolmentDateTime;
    const individual = programEnrolment.individual;

    visibility = height && weight;

    if(visibility) {

        const zScoresForChild = ruleServiceLibraryInterfaceForSharingModules.common.getZScore(individual, asOnDate, weight, height);

        const weightForHeightStatus = function (zScore) {
            if(zScore >= 3) return 'Obese'
            if(zScore >= 2 && zScore < 3) return 'Overweight'
            if(zScore < 2 && zScore >= -2) return 'Normal'
            if(zScore > -3 && zScore < -2) return 'Wasted'
            if(zScore <= -3) return 'Severely wasted'

            return 'Unknown'
        };

        const wfhStatus = weightForHeightStatus(zScoresForChild.wfh);

        value = wfhStatus;
    }
    return new imports.rulesConfig.FormElementStatus(formElement.uuid, visibility, value, answersToSkip, validationErrors);
};

